import React from 'react';

function Footer() {
  return (
    <footer className="bg-gray-900 text-white py-8">
      <div className="container mx-auto">
        <ul className="footer-links flex justify-center space-x-4">
          <li><a href="#" className="text-white">Refer</a></li>
          <li><a href="#" className="text-white">Benefits</a></li>
          <li><a href="#" className="text-white">FAQs</a></li>
          <li><a href="#" className="text-white">Support</a></li>
        </ul>
      </div>
    </footer>
  );
}

export default Footer;
